function checkTransaction() {
    const txDirection = $json["tx_direction"];
    const acFlowDirection = $json["ac_flow_direction"];
    const txTextToAnalyze = $json["tx_text_to_analyze"];
    const acExpression = $json["ac_expression"];
    const acRecId = $json["ac_rec_id"];

    // Check if any inputs are missing
    if (!txDirection || !acFlowDirection || !txTextToAnalyze || !acExpression || !acRecId) {
        console.error("Missing Inputs");
        return { result: "Missing Inputs" };
    }

    // Check flow direction
    if ((acFlowDirection === "Income Only" && txDirection !== "Income") ||
        (acFlowDirection === "Expense Only" && txDirection !== "Expense")) {
        return { result: "No Match" };
    }

    // Check regex match
    try {
        const regex = new RegExp(acExpression);
        if (regex.test(txTextToAnalyze)) {
            return { result: "Match", ac_rec_id: acRecId };
        } else {
            return { result: "No Match" };
        }
    } catch (error) {
        console.error("Invalid regex:", acExpression);
        return { result: "Error in regex" };
    }
}

return checkTransaction();

